import React from 'react';

//import Image
import Image3 from '../assets/img/feature-3-img.png';

const FeaturesSection3 = () => {
  return (
    <section className='py-[30px] lg:py-[120px]'>
    <div className='flex flex-col lg:flex-row'>
      {/*text */}
      <div className='max-w-[454px] mb-6 lg:mt-10' data-aos='fade-right' data-aos-offset='400'>
        <h3 className='h3 mb-6'>Invest  Smart</h3>
        <p className='text-gray mb-8'>
          Get full statistic information about the behaviour of buyers and sellers
          will help you to make the decision.
        </p>
        <button className='btn px-8'>Learn more</button>
      </div>
      {/*Image*/}
      <div className='flex-1 flex justify-end' data-aos='fade-left' data-aos-offset='400'>
        <img src={Image3}/>
      </div>
    </div>
  </section>
    );
};

export default FeaturesSection3;
